import { Button } from "bootstrap";
import React from "react";
import "../../.././assets/index.css";
import Buttons from "../Buttons/Buttons";

const SearchBar = () => {
  return (
    <form action="/" method="get">
      <div style={{height:"40px", display:"flex", flexDirection:"row"}}>
        <label htmlFor="header-search">
          <span className="visually-hidden">Search for People</span>
        </label>
        <input
          type="text"
          id="header-search"
          placeholder="Search for People..."
          name="s"
          style = {{width : "400px", height:"40px", padding:""}}
        />
        <Buttons value="Search" style={{background:"black", borderColor:"crimson"}}/>
      </div>
    </form>
  );
}
export default SearchBar;
